Sensing Murder (New Zeeland version 16:9)

Olive Walker

Season 1, Episode 3 Aired: 1/24/2006

In this episode, we learn about the story of Olive Walker, who was an 18-year-old Maori girl who lived in Rotorua. In 1970 she was snatched off the street and murdered as she walked to her sister's house to baby sit.

